import React from 'react';
import { View,Text, TextInput, Button,StyleSheet,Image } from 'react-native';


const logo=  "../../assets/images/logo.jpg";

function SignIn(props) {
    return (
        <div>
          <View style={styles.container}>
                <Text> <h3>Signup</h3> </Text>
                <Image className={styles.Img} source={logo} />
               <form>
                <View>
                    <Text id="Email" name="Email"><h3>Email</h3></Text>
                    <TextInput for="#Email" type="email" placeholder="Please enter your Email here!!"/>
                </View>
                <br/>
                <View>
                    <Text id="Email" name="Email"><h3>Password</h3></Text>
                    <TextInput for="Password" secureTextEntry={true} placeholder="Please enter Passowrd"/>
                </View>
                <br/>
                <Button type="submit" title="SIGN IN"> </Button>

                </form>
            </View>
            
            
        </div>
    );
}

export default SignIn;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: '',
      justifyContent: '',
    },
    Img:{
        height:'40px',
        width:'40px',
        backgroundColor:"black"
    }
  });
